import React from 'react'

export default function Exports() {
  return (
    <div className="mx-w-[1240px] mx-auto my-10 h-[200px] border border-[#1a2e05] grid grid-cols-3">
      <div className="border border-[#1a2e05] col-span-1"></div>
      <div className="border border-[#1a2e05] col-span-2"></div>
    </div>
  );
}
